/*

YouTube and YouTube Logo are registered by Google Inc. trademarks.
no-avatars is not affilated with Google Inc. and YouTube
Note: i know it's not the best of realizations, but it works and i have no problem using it

*/

(async function() {
    'use strict';
    setInterval(() => {
        var Images = document.querySelectorAll("img")
        Images.forEach((avatar) => {
            if (avatar.src === "data:image/gif;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAQAAAC1HAwCAAAAC0lEQVR42mN8XA8AAksBZG7LpHYAAAAASUVORK5CYII=") {
                avatar.src = "data:image/png;base64,";
            }
        });
    }, 1000);
})();
